import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'react-bootstrap';
import Header from './components/Header/Header';
import { Routes , Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route pat='/' />
      </Routes>
    </div>
  );
}

export default App;
